#include <QByteArray>
#include <QPixmap>
#include <QDebug>

class Resources {
    QByteArray background;
    QByteArray flyfighter;
    QByteArray fireball;
    QByteArray bomb;
public:
    Resources(){
        //За раз std::string может хранить до 16кб символов, не катит...
        background+="";
        background+="";
        background+="";
        background+="";
        background+="";
        background+="";
        background+="";
        background+="";
        background+="";
        background+="";

        flyfighter+="";

        fireball+="";

        bomb+="";

        background=QByteArray::fromHex(background);
        flyfighter=QByteArray::fromHex(flyfighter);
        fireball=QByteArray::fromHex(fireball);
        bomb=QByteArray::fromHex(bomb);
    }

    QByteArray GetBackgroundImage(){
        return background;
    }

    QByteArray GetFlyFighterImage(){
        return flyfighter;
    }

    QByteArray GetFireBall(){
        return fireball;
    }

    QByteArray GetBomb(){
        return bomb;
    }
};
